import React, { Component } from 'react';
import loslagos_1 from './img/loslagos_1.png';
import loslagos_2 from './img/loslagos_2.png';
import Contacto from './Contacto'

const message = () => {
    <Contacto />
}


class Home extends Component {

    state = {
        "img": loslagos_1
    }

    render() {
        return (
            <div class='/'>


                <img
                    src={this.state.img}
                    onMouseEnter={() => {
                        this.setState({
                            "img": loslagos_2
                        })
                    }}

                    onMouseOut={() => {
                        this.setState({
                            "img": loslagos_1
                        })
                    }}
                />
            </div>
        );
    }
}

export default Home;
